import React,{useRef,useState} from 'react';
import './Video.css';
import danielle from './danielle.mp4';

function Video() {
    const [playing,setPlaying]= useState(false);
    const videoRef=useRef(null);
    const handleVideoPress = () => {
        if(playing){
            videoRef.current.pause();
            setPlaying(false);
        } else{
            videoRef.current.start();
            setPlaying(true);
        }    
    };

    return (
        <div className="video">
            <video onClick={handleVideoPress} className="video_player" loop src={danielle}> </video>            

        </div>
    )
}

export default Video;
